REP_palpatine_desc:0 "Born to a very influential family on Naboo, Sheev Palpatine was raised in the planetary capital of Theed, where he learned much about governance and the nature of power. He joined Naboo's reputable host of credible politicians, but his pursuit of forbidden knowledge in the form of Sith relics led him to meeting and becoming the apprentice of the Dark Lord of the Sith, Darth Plagueis. Plagueis trained him in the Dark Side of the Force, and assisted in Palpatine's rise to the position of Senator for Naboo in the Galactic Senate. There, as a member of Supreme Chancellor Skor Kalpana's ruling faction, Palpatine discovered the fervent bickering and corruption that stalled the Republic. This corruption became Palpatine's greatest tool, coming to the forefront during the Naboo Crisis, where he managed to convince Naboo's Queen to call a vote of no confidence in then Supreme Chancellor Finis Valorum, whose reputation has been tarnished by scandals Palpatine himself had fabricated. This vote led to Palpatine's nomination and victorious election to the Chancellorship. He has been in power ever since, managing to extend his term through constitutional loopholes. Controlling numerous manufactured emergencies, Sheev Palpatine is publicly a humble, trustworthy, and even reluctant leader, with massive popularity."
